	Details:EraseProfile(name)
	-- Profile import
	Details:ImportProfile(profileString, name)

	-- Apply the profile
	if Details:GetCurrentProfileName() ~= name then
		Details:ApplyProfile(name)
	end

	-- Load the profile on all characters
	Details.always_use_profile = true
	Details.always_use_profile_name = name

	if installer then
        PluginInstallStepComplete.message = "Details profile has been set."
        PluginInstallStepComplete:Show()
	end

	Private:Print("Details profile has been set.")
end